    const Navigate=useNavigate();
    return (

        <div>
          <Main>
<GridRow>
  <GridCol>
    <div>

    <Button buttonColour="#1d70b8" onClick={()=>Navigate("/DoctorAppointment")}>
  Doctor Appointments</Button>
    </div>
  </GridCol>
  <GridCol>
    <div >

    <Button buttonColour="#1d70b8" onClick={()=>Navigate("/DoctorAppointment")}>
  view Patient Records and update it
</Button>
    </div>
  </GridCol>

</GridRow>
</Main>
        </div>
    );

}
